import { useHistory } from "react-router-dom";
import Card from "../components/UI/Card";
import "./LiveChat.css";

const LiveChat = () => {
  const history = useHistory();

  // Render component
  return (
    <div className="live-chat px-3 py-5">
      <h5>Live chat</h5>
      <Card className="mt-4 py-3 row mx-0">
        <div className="live-chat__left col-lg-3">
          <input className="form-control" type="text" placeholder="Search contact . . ." />
        </div>
        <div className="live-chat__right col-lg-9">Chatting</div>
      </Card>
    </div>
  );
};

export default LiveChat;
